import React from 'react';
import './App.css';
import ChatContainer from './Component/Chat/ChatContainer'
import Signup from './Component/Auth/Signup'
import Signin from './Component/Auth/Signin'

function App() {
	const token = localStorage.getItem('_token')

	return (
		token ?
			<ChatContainer/>
		:
			<Signin/>
);
}

export default App;
